def _try_convert_to_date(self, data):
    """
    Try to parse a ndarray like into a date column.

    Try to coerce object in epoch/iso formats and integer/float in epoch
    formats. Return a boolean if parsing was successful.
    """
    # no conversion on empty
    if not len(data):
        return data, False

    new_data = data
    if new_data.dtype == "object":
        try:
            new_data = pd.to_numeric(new_data, errors="coerce")
        except (ValueError, TypeError, OverflowError):
            pass

    # ignore numbers that are out of range
    min_stamp = np.datetime64('NaT')
    iNaT = np.datetime64('NaT')
    if new_data.dtype.kind in 'iuf':
        in_range = (
            isna(new_data)
            | (new_data > min_stamp)
            | (new_data == iNaT)
        )
        if not in_range.all():
            return data, False

    date_unit = self.date_unit
    if date_unit:
        if isinstance(date_unit, str):
            date_unit = [self.date_unit]
    else:
        date_unit = self._STAMP_UNITS

    for unit in date_unit:
        try:
            new_data = pd.to_datetime(new_data, errors="raise", unit=unit)
            return new_data, True
        except (ValueError, OverflowError):
            pass

    return data, False
